import React from 'react'
import ItemListTable from '../sub-components/ItemListTable'
import { newItemListPayload } from "../../helpers/testPayload/itemListPayload";

const ItemList = () => {
  return (
    <div data-testid="item-list-component">
      <ItemListTable payload={newItemListPayload.data.items} />
    </div>
  )
}

export default ItemList
